webpackJsonp(6,{41:function(a,b,c){a.exports='<h1>Contribute</h1><p>We are always looking for more contributors and there are many ways you can help!</p><ul><li>Open an <a href="https://github.com/shama/jmpress.js/issues">issue</a> for a bug or a feature request</li><li>Send us a message if you&#39;re using jmpress.js</li><li>Add/update the test cases</li><li>Fix a bug or write a feature then submit a pull request</li></ul><p>Thank you for using and contributing to jmpress.js!</p><h2>Edit &amp; Build</h2><p>All the source files are located in the <code>src/</code> folder. They are broken up into components and plugins to allow users to build their own <a href="#builder">customized version</a> of jmpress.js.</p><h3>Grunt</h3><p>We use the command line build tool: <a href="https://github.com/cowboy/grunt">grunt</a>. It requires Node.js. If you already have Node.js installed, navigate to your copy of jmpress.js and run the command: <code>npm link</code> to install any development dependencies. Then use the command <code>grunt</code> to build jmpress.js. You can also use the command <code>grunt watch</code> to continuously build jmpress.js as you edit.</p><p>The output files will be located in the <code>dist/</code> folder. Please do not edit any files in the <code>dist/</code> folder as they are automatically generated.</p><h2>Pull Requests</h2><p>Good news! We accept pull requests!</p><p>Please work and pull against the <code>dev</code> branch to make sure you are using the latest code. Thanks!</p><h2>Tests</h2><p>jmpress.js uses <a href="http://docs.jquery.com/QUnit">QUnit</a> for testing. Please run <code>/tests/</code> in your browser to run the tests or the command: <code>grunt qunit</code>.</p><p><em>Currently the tests need a lot of catching up. Any help you can provide will be very much appreciated.</em></p><h2>Docs</h2><p>If you find an error or something missing please edit and submit a pull request.</p><h2>Wishlist</h2><ul><li>Browser Support (hard but important)</li><li>Better fallback support for older browsers</li><li>Community for plugins</li></ul>'}})